import {Link} from "react-router-dom"


export default class Navbar extends Component {
  render() {

    return (
      <div style={{display:"flex",padding:"1rem",color:"#3742fa"}}>
      <Link to="/"></Link>
     
        <h2 style={{marginLeft:"2rem",marginTop:"0.8rem"}}>Favourites</h2>
      </div>
    )
  }
}
